import React from 'react';
import {range, Vec2} from '../utility';
import Cell from './Cell';

type GridProps = {position: Vec2};

const Grid: React.FC<GridProps> = (props) => {
    return (
        <div>
            {range(0, 10).map((row) =>
                range(0, 10).map((col) => {
                    return (
                        <>
                            {/*czy row i col powinny miec typ?*/}
                            <Cell
                                fill={props.position.isEqual(
                                    new Vec2({row: 3, col: 3}),
                                )}
                                position={{row, col}}
                            />
                            {col == 9 ? <br /> : null}
                        </>
                    );
                }),
            )}
        </div>
    );
};

export default Grid;
